import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the 'View All →' link to be visible and then click it
    await page.waitForSelector('a.view-all-link', { timeout: 5000 });
    await page.click('a.view-all-link');

    // Wait for the dashboard page to load
    await page.waitForLoadState('networkidle');

    // Take a screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_view_all_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_view_all_clicked.png'));

    // Verify navigation by checking for an element that appears on the dashboard
    const dashboardElement = await page.waitForSelector('.dashboard-title', { timeout: 5000 });
    const dashboardTitle = await dashboardElement.innerText();

    return {
      success: true,
      action: "Clicked the 'View All →' link and navigated to the dashboard",
      extractedData: {
        dashboardTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
